public boolean equals(final Object o) {
  if (this == o) {
    return true;
  }
  if (o == null || getClass() != o.getClass()) {
    return false;
  }
  if (!super.equals(o)) {
    return false;
  }
  final AbstractS3ATokenIdentifier that = (AbstractS3ATokenIdentifier) o;
  return Objects.equals(uuid, that.uuid) &&
      Objects.equals(uri, that.uri);
}
